import React,{ Component }  from 'react';
import csvToJSON from "./csvToJSON" 
import {Footer} from "./Footer"


class CollectData extends Component{
    constructor(){
        super()
        this.state = {
            contactData:{},
            jobsData:[]
        }
    }
    componentDidMount(){  
        const urlContacts="https://raw.githubusercontent.com/kmagdi/KSZC-Data/master/elerhetosegek.csv"    
        fetch(urlContacts)           
            .then(resp=>resp.text())
            .then(text=>{
                const contactsJSON=csvToJSON(text, ';')
                this.setState({contactData:contactsJSON[0]})
            })
   }

render(){
     return(
        <div>
            <Footer contactData={this.state.contactData} jobsData={this.state.jobsData}/>
        </div>
    )}   
}
export default CollectData
